import React from "react";
import styled from "styled-components";
const LandingPage = () => {
  const CurveSvg = styled.svg`
    position: absolute;
    top: 0;
    right: 0;
  `;

  const Menu = styled.svg`
    padding: 45px 60px;
  `;

  return (
    <div>
      <div>
        <CurveSvg
          width="579"
          height="575"
          viewBox="0 0 579 575"
          fill="none"
          xmlns="http://www.w3.org/2000/svg"
        >
          <path
            fill-rule="evenodd"
            clip-rule="evenodd"
            d="M579 0H0.613831C19.1535 57.3041 60.1238 101.507 129.985 120.207C283.486 161.295 287.511 258.165 291.408 351.931C296.177 466.7 300.752 576.82 579 574.309V0Z"
            fill="#292F4F"
          />
        </CurveSvg>
      </div>
    </div>
  );
};

export default LandingPage;
